require("isomorphic-fetch");

function getCuber(name) {
	// console.log(name);
	return fetch(`http://localhost:3001/api/cubes?name=${name}`).then(function(resp) 
	{
		return resp.json();
	});
}

function handleError(error) {
	console.warn(error);
	return null;
}

module.exports = {
	getInfo: function(name) {
		return getCuber(name).catch(handleError);
	}
};
